def known_plural(word):
    return word in plural_of.values() or\
        word in singular_of.keys() or\
        word in past_of.values() or\
        word in pres_part_of.values() or\
        word in past_part_of.values()

def known_singular(word):
    return word in singular_of.values() or\
        word in plural_of.keys() or\
        word in past_of.values() or\
        word in pres_part_of.values() or\
        word in past_part_of.values()

def known_past(word):
    return word in past_of.values()

def known_past_part(word):
    return word in past_part_of.values()

def known_pres_part(word):
    return word in pres_part_of.values()

def convert_to_plural(word):
    if word in plural_of:
        return plural_of[word]
    if word.lower() in plural_of:
        return plural_of[word.lower()]
    if known_plural(word):
        return word
    for rule in plural_convert_rules:
        if rule.match(word):
            return plural_convert_rules[rule]
    return '_'

def convert_to_singular(word):
    if word in singular_of:
        return singular_of[word]
    if word.lower() in singular_of:
        return singular_of[word.lower()]
    if known_singular(word):
        return word
    for rule in singular_convert_rules:
        if rule.match(word):
            return singular_convert_rules[rule]
    return '_'

def convert_to_past(word):
    if word in past_of:
        return past_of[word]
    if word.lower() in past_of:
        return past_of[word.lower()]
    if known_past(word):
        return word
    for rule in past_convert_rules:
        if rule.match(word):
            return past_convert_rules[rule]
    return '_'

def convert_to_pres_part(word):
    if word in pres_part_of:
        return pres_part_of[word]
    if word.lower() in pres_part_of:
        return pres_part_of[word.lower()]
    if known_pres_part(word):
        return word
    for rule in pres_part_convert_rules:
        if rule.match(word):
            return pres_part_convert_rules[rule]
    return '_'

def convert_to_past_part(word):
    if word in past_part_of:
        return past_part_of[word]
    if word.lower() in past_part_of:
        return past_part_of[word.lower()]
    if known_past_part(word):
        return word
    for rule in past_part_convert_rules:
        if rule.match(word):
            return past_part_convert_rules[rule]
    return '_'

def is_plural(word):
    if known_plural(word) or known_plural(word.lower()):
        return True
    if known_singular(word) or known_singular(word.lower()):
        return False
    for rule in plural_recognize_rules:
        if rule.match(word):
            return True
        return False

def is_singular(word):
    if known_singular(word) or known_singular(word.lower()):
        return True
    if known_plural(word) or known_plural(word.lower()):
        return False
    for rule in singular_recognize_rules:
        if rule.match(word):
            return True
        return not is_plural(word)

def is_past(word):
    if known_past(word) or known_past(word.lower()):
        return True
    for rule in past_recognize_rules:
        if rule.match(word):
            return True
        return False

def is_pres_part(word):
    if known_pres_part(word) or known_pres_part(word.lower()):
        return True
    for rule in pres_part_recognize_rules:
        if rule.match(word):
            return True
        return False

def is_past_part(word):
    if known_past_part(word) or known_past_part(word.lower()):
        return True
    for rule in past_part_recognize_rules:
        if rule.match(word):
            return True
